const map_custom_shortname_id = {}

export const add_custom_shortnames = shortnames => {
    let id = Object.keys(map_shortname_id).length
    const array = map_category_shortnames["custom"]
    shortnames.forEach(shortname => {
        map_shortname_id[shortname] = id
        map_custom_shortname_id[shortname] = id
        map_shortname_category[shortname] = "custom"
        array.push(shortname)
        id++
    })
}

export const search_by_shortname = keyword => {
    const shortnames = Object.keys(map_shortname_id)
    const prefix_match_result = []
    const result = []
    shortnames.forEach(shortname => {
        const index = shortname.indexOf(keyword)
        if (index >= 0) {
            const category = get_category_by_shortname_or_null(shortname)
            if (category) {
                if (index === 0) {
                    prefix_match_result.push({ shortname, category })
                } else {
                    result.push({ shortname, category })
                }
            }
        }
    })
    return prefix_match_result.concat(result)
}

const map_id_shortname = new Array(Object.keys(map_shortname_id).length)
Object.keys(map_shortname_id).forEach(shortname => {
    const id = map_shortname_id[shortname]
    map_id_shortname[id] = shortname
})

export const is_custom_shortname = shortname => {
    if (map_custom_shortname_id[shortname]) {
        return true
    }
    return false
}

export const get_image_url_by_shortname_or_null = (shortname, server_id) => {
    const category = get_category_by_shortname_or_null(shortname)
    if (category === null) {
        return null
    }
    if (category === "custom") {
        return `/asset/emoji/shortnames/${server_id}/${shortname}`
    }
    return `/asset/emoji/shortnames/${shortname}`
}

export const get_category_by_shortname_or_null = shortname => {
    const category = map_shortname_category[shortname]
    if (!!category === false) {
        return null
    }
    return category
}

