export const get_shortname_by_unicode = unicode => {
    const id = map_unicode_id[unicode]
    if (!!id === false) {
        return null
    }
    const shortname = map_id_shortname[id]
    if (!!shortname == false) {
        return null
    }
    return shortname
}

class HistoryStore {
    @observable.shallow list = []
    constructor(server) {
        if (!!server === false) {
            return
        }
        assert(is_object(server), "$server must be of type object at HistoryStore.constructor")
        this.server = server

        const history_str = localStorage.getItem(`emoji.history.${server.id}`)
        if (!!history_str == false) {
            return
        }
        const shortnames = JSON.parse(history_str)
        if (Array.isArray(shortnames) === false) {
            return
        }
        if (shortnames.length > 0) {
            shortnames.forEach(emoji => {
                const { shortname, category } = emoji
                this.list.push({
                    shortname, category
                })
            })
        }
    }
    @action.bound
    add(shortname, category) {
        assert(is_string(shortname))
        assert(is_string(category))
        const list = []
        this.list.forEach(item => {
            if (shortname === item.shortname) {
                return
            }
            list.push(item)
        })
        list.unshift({ shortname, category })
        if (list.length > config.emoji.history.capacity) {
            list.pop()
        }
        this.list = list
        localStorage.setItem(`emoji.history.${this.server.id}`, JSON.stringify(list))
    }
}

class PickerStore {
    @observable is_searching = false
    @observable current_category = null
    @observable.shallow history = null
    constructor(server) {
        if (server) {
            this.server = server
            this.history = new HistoryStore(server)
        }
    }
    @action.bound
    show = (callback_pick, callback_hide) => {
        this.callback_pick = callback_pick
        this.callback_hide = callback_hide
    }
    @action.bound
    hide = () => {
        if (this.callback_hide) {
            this.callback_hide()
        }
        this.callback_pick = null
        this.callback_hide = null
        this.is_searching = false
    }
    pick = (shortname, category) => {
        if (this.history) {
            this.history.add(shortname, category)
        }
        if (this.callback_pick) {
            this.callback_pick(shortname, category)
        }
    }
    get_emoji_history = () => {
        if (this.history) {
            return this.history.list
        }
        return []
    }
    @action.bound
    set_current_category = category => {
        this.current_category = category
    }
    @action.bound
    set_is_searching = is_searching => {
        this.is_searching = is_searching
    }
}

class Empty {
    get_emoji_history = () => {
        return []
    }
    set_current_category = category => { }
}

const get_picker_class = () => {
    if (typeof localStorage === "undefined") {
        return Empty
    } else {
        return PickerStore
    }
}

export const EmojiPickerStore = get_picker_class()

const map_server_picker = {}
let default_picker = null
export const get_shared_picker_store = server => {
    if (!!server === false) {
        if (default_picker) {
            return default_picker
        }
        default_picker = new (get_picker_class())()
        return default_picker
    }
    let picker = map_server_picker[server.id]
    if (picker) {
        return picker
    }
    picker = new (get_picker_class())(server)
    map_server_picker[server.id] = picker
    return picker
}